import React from "react";

const ContactCard = () => {
    return (
        <div className="item">
        <div className="content">
            <div className="header">{contact.name}</div>
            <div>{contact.Email}</div>
        </div>
        <i className="trash alternative outline icon" 
            style={{color:"red", marginTop:"7px"}}/>
    </div>
    )
}
